import { createSlice } from "@reduxjs/toolkit";

const bntSlice = createSlice({
  name: "Btn",
  count: { value: 0 },
  reducers: {
  addBtn: ( state ) => {
  state.value +=1
  },
  delBtn: ( state ) => {
  state.value -=1
  }
}
})

export const {addBtn, delBtn} = bntSlice.actions
export default bntSlice.reducer
